// Footer.js
import './footer.css';
import React from 'react';
import background from '../pic/background.png'

const Footer = () => {
  return (
    <footer>
        <div>
            <img  src={background} className='background' alt="background image"/></div>
        <div>
            <p>Say Hello</p>
        </div>
    </footer>
  );
};

export default Footer;
